        setUserInput(value);
    }
    return(
        <div className="imgLink">
           <div>
           <p className="imgLinkText">Enter an image URL and find faces</p>
            <div style={{width: "100%", 
            display : "flex", 
            justifyContent: "center", 
            flexWrap :"wrap", 
            boxShadow:"none",
            border : "none"
            }}>
                <input type="text" placeholder="Enter Link Here...." value={userInput}/>
                <button>Detect</button>
            </div>
           </div>
        </div>
    )
}

